function executeStatementsArray(db, statementsArray) {
	db.transaction(function (t) {
		for(i in statementsArray) {
			var statements = statementsArray[i].split(";");
			for(j in statements) {
				t.executeSql(statements[j]);
			}
		}
	}, errorHandler, completionHandler);
}

function errorHandler(e) {
	alert(e.message);
}

function completionHandler(e) {
	console.log("Database is ready!");
}

